pub enum CommunicationError {
    DerefErr {
        offset: u32,
        msg: String,
        backtrace: snafu::Backtrace,
    },
    InvalidOrder {
        value: i32,
        backtrace: snafu::Backtrace,
    },
    InvalidRegion {
        source: RegionValidationError,
    },
    InvalidUtf8 {
        msg: String,
        backtrace: snafu::Backtrace,
    },
    RegionLengthTooBig {
        length: usize,
        max_length: usize,
        backtrace: snafu::Backtrace,
    },
    RegionTooSmall {
        size: usize,
        required: usize,
        backtrace: snafu::Backtrace,
    },
    ZeroAddress {
        backtrace: snafu::Backtrace,
    },
}

pub enum RegionValidationError {
    LengthExceedsCapacity {
        length: u32,
        capacity: u32,
        backtrace: snafu::Backtrace,
    },
    OutOfRange {
        offset: u32,
        capacity: u32,
        backtrace: snafu::Backtrace,
    },
    ZeroOffset {
        backtrace: snafu::Backtrace,
    },
}

pub enum VmError {
    CacheErr {
        msg: String,
        backtrace: snafu::Backtrace,
    },
    CommunicationErr {
        source: CommunicationError,
    },
    CompileErr {
        msg: String,
        backtrace: snafu::Backtrace,
    },
    ConversionErr {
        from_type: String,
        to_type: String,
        input: String,
        backtrace: snafu::Backtrace,
    },
    GenericErr {
        msg: String,
        backtrace: snafu::Backtrace,
    },
    InstantiationErr {
        msg: String,
        backtrace: snafu::Backtrace,
    },
    IntegrityErr {
        backtrace: snafu::Backtrace,
    },
    IteratorDoesNotExist {
        id: u32,
        backtrace: snafu::Backtrace,
    },
    ParseErr {
        target: String,
        msg: String,
        backtrace: snafu::Backtrace,
    },
    SerializeErr {
        source: String,
        msg: String,
        backtrace: snafu::Backtrace,
    },
    ResolveErr {
        msg: String,
        backtrace: snafu::Backtrace,
    },
    RuntimeErr {
        msg: String,
        backtrace: snafu::Backtrace,
    },
    StaticValidationErr {
        msg: String,
        backtrace: snafu::Backtrace,
    },
    UninitializedContextData {
        kind: String,
        backtrace: snafu::Backtrace,
    },
    FfiErr {
        source: FfiError,
    },
    GasDepletion,
    WriteAccessDenied {
        backtrace: snafu::Backtrace,
    },
}

pub enum FfiError {
    ForeignPanic {
        backtrace: snafu::Backtrace,
    },
    BadArgument {
        backtrace: snafu::Backtrace,
    },
    InvalidUtf8 {
        backtrace: snafu::Backtrace,
    },
    OutOfGas {
    },
    Unknown {
        msg: Option<String>,
        backtrace: snafu::Backtrace,
    },
    UserErr {
        msg: String,
        backtrace: snafu::Backtrace,
    },
}
